const t="حصص البيلاتس في باريس – بيوبيلاتس",o="ابدأ رحلتك نحو التوازن والانسجام في بيوبيلاتس",i={description:"ابدأ رحلتك نحو التوازن والانسجام مع <strong>بيوبيلاتس</strong>، حيث تتحول الحركة إلى أسلوب حياة.انضم إلى حصص البيلاتس المصمَّمة خصيصًا لمساعدتك على تحقيق أهدافك بخطوات واثقة.بين أيدي مدربين معتمدين وخبراء في الحركة والميكانيكا الحيوية، ستجد التوجيه والدعم لتصحيح وضعياتك وتطوير أدائك بثقة.ومع كل تمرين، ستشعر بـتغيّر حقيقي في جسدك وذهنك.",benefits:{physical:"لياقة بدنية أفضل",body:"جسم أقوى وأكثر مرونة",mind:"صفاء ذهني وتوازن داخلي"}},s={title:"حصص بيوبيلاتس(Biopilates)",description:"اكتشف تجربة بيلاتس شاملة تجمع بين القوة، المرونة، والتركيز الذهني. يقّدم لك استوديو بيوبيلاتس جلسات بإشراف مدربين محترفين ومعتمدين وفقا أعلى المعايير الدولية. ً ابدأ رحلتك نحو التوازن والانسجام .احجز حصتك اليوم عبر <a href='#app'><u><strong>تطبيق استوديو بيوبيلاتس(Biopilates).</strong></u></a>"},e={title:"كيفية التسجيل في الحصص",description:"نستخدم تطبيقاً خاصا بالاستديو لتسهيل الحجز والمتابعة. ندعوك إلى اتباع الإرشادات التالية للتسجيل في المنصة المتاحة ً على جهاز الكمبيوتر الخاص بك ولحجز حصتك القادمة. يرجى مراجعة واستكمال وتعديل المعلومات الخاصة بك إذا لزم الأمر، خاصة إضافة طرق الدفع الخاصة بك لتفعيل اشتراكك وتجديده تلقائياً. <p><strong> فريق استوديو بيوبيلاتس(Biopilates).</strong></p>",download:"تحميل",googlePlay:"Google Play",appStore:"App Store"},r={validity:"الصلاحية",months:"أشهر",perWeek:"/ أسبوع",send:"إرسال",book:"حجز",title:"عروضنا وأسعارنا",description:'يتم <strong>الإلغاء</strong> قبل 12 ساعة للحصص الجماعية، و24 ساعة للحصص شبه الخاصة، و48 ساعة للحصص الخاصة، وإلا سيتم احتساب الحصة. لا يمكن إجراء أي تغيير على الحجز.لا يمكن للعميل التسجيل عبر "كلاس باس " (Classpass) إذا كان قد زار استوديو بيوبيلاتس مسبقاً بشكل مباشر. <br />للانضمام أو  الحصول على عضوية VIP ،يُرجى التواصل عبر البريد الإلكتروني <a href="mailto:administration@biopilates.fr" style="color: inherit; text-decoration: underline; cursor: pointer; font-weight: 700;">administration@biopilates.fr</a>',bookClass:"درس"},n={reformer:{title:"حصص ريفورمر (REFORMER)",description:"استعد لحصة مليئة بالطاقة والحماس على جهاز الريفورمر،وهي الأكثر شعبية ضمن الحصص الجماعية (12 مشارك كحد أقصى). قّو عضلاتك بعمق، حسن وضعيتك، وطور مرونتك من خلال طريقة البيلاتس الخاصة بنا. حصص لجميع المستويات. <p>احجز حصتك التجريبية اليوم.</p>",course:"ريفورمر (REFORMER)"},reformerGyrotonic:{title:"حصص ريفورمر وجيروتونيك",description:"هل تبحث عن تمرين مليء بالتحدي والطاقة ؟ مع حصصنا بحد أقصى( 6 مشاركين)، تتيح لك الاستفادة من كل المعدات: الريفورمر، الكاديلاك، الكرسي، برج الجيروتونيك، وجميع الإكسسوارات. حصص مناسبة لجميع المستويات .استمتع بتجربة بيلاتس فريدة وشخصية في استوديو بيوبيلاتس!",course:"ريفورمر وجيروتونيك"},reformerGyrotonicEvolis:{title:"حصص ريفورمر وجيروتونيك وإيفوليس",description:"حصص مكثفة خاصة أو ثنائية مع تدريب ومتابعة احترافية. الوصول الكامل لجميع معدات جيروتونيك (وحدة التمديد، كرسي البرج، لوحة القفز والتمدد)، بيلا تس (ريفورمر، كاديلاك، كرسي، براميل، الإكسسوارات) وإيفوليس (الآلة التي تخفف آلام الظهر).",course:"ريفورمر وجيروتونيك وإيفوليس"}},a={title:t,subtitle:o,instructors:i,biopilates:s,registration:e,offers:r,courses:n};export{s as biopilates,n as courses,a as default,i as instructors,r as offers,e as registration,o as subtitle,t as title};
